	count = 0 # May need to start at 1 instead
	callDictionary = {}
	print(len(graphicsBytes))
	count = int(len(graphicsBytes) / 36)
	for x in range(count):
		segment = graphicsBytes[x * 36: (x + 1) * 36 ]
		result = characters.graphicsData.get(segment.hex())
